	"\x8e\xaf\xed\xb1" => 0x2759f,
	"\x8e\xaf\xed\xb2" => 0x2a232,
	"\x8e\xaf\xed\xb3" => 0x2820d,
	"\x8e\xaf\xed\xb4" => 0x2298b,
	"\x8e\xaf\xed\xb5" => 0x28c3b,
	"\x8e\xaf\xed\xb7" => 0x2a23d,
	"\x8e\xaf\xed\xb8" => 0x28c3c,
	"\x8e\xaf\xed\xb9" => 0x28c3d,

);

my $conv_re;
sub _recode
{
	my $unknown = $_[0]->{_unknown};

	if ($_[0]->{_from} eq 'INTERNAL') {
    	my $unknown_chr = $from_ucs{$unknown};
    	$unknown_chr = '' unless defined $unknown_chr;
		$_[1] = join ('',
					  map ($from_ucs{$_} || 
						   (exists $from_ucs{$_} ? $from_ucs{$_} :
							$unknown_chr),
						   @{$_[1]}));
    } else {
		# FIXME: This is awfully slow!
		unless ($conv_re) {
			$conv_re = qr /(?:(?:\x8e[\xa1-\xaf])?[\xa1-\xfe][\xa1-\xfe]|.)/so;
		}

		my @outbuf;
		$_[1] =~ s/($conv_re)/
			push @outbuf, ($to_ucs{$1} || 
						   (exists $to_ucs{$1} ?
							0 : $unknown));
			/gsex;

		$_[1] = \@outbuf;
    }

    return 1;
}

1;

